function Hari1(props){
    return(
        <div>
            fullname:{props.fname}<br/>
            lastname:{props.laname}<br/>
            age:{props.age}<br/>
            salary:{props.salary}<br/>
        </div>
    )
}
function Hari(){
    return(
     <div>
        <h1>Somme employee</h1>
        <Hari1 fname="naveen" laname="yakklauru" age="25" salary="40000"/>
     </div>
    )
}
export default Hari;
